import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

export default function Footer() {
  return (
    <footer className="fixed-bottom bg-orange-100 border-top border-gray-200 shadow">
      <Container fluid className="md-flex md-items-center md-justify-center md-p-4 dark-bg-gray-800 dark-border-gray-600">
        <Row>
          <Col md="6" className="text-center">
              Copyright 2023 | Qdine. All Rights Reserved
          </Col>
        </Row>
      </Container>
    </footer>
  );
}
